      return $scope.$broadcast('DataUpdated');
    };
    $scope.buildSeries = function() {
      var areaGraphs, data, groupName, groups, hostname, name, overallData, series;
      if ($scope.data.responses && $scope.data.responses.overall) {
        overallData = $scope.data.responses.overall;
      } else {
        overallData = {};
        setTimeout((function() {
          return location.reload(true);
        }), 3000);
      }
      areaGraphs = ['CPU', 'Memory'];
      $scope.monitoringData = (function() {
        var _ref, _results;
        _ref = $scope.data.monitoring;
        _results = [];
        for (hostname in _ref) {
          groups = _ref[hostname];
          _results.push({
            hostname: hostname,
            groups: (function() {
              var _results1;
              _results1 = [];
              for (groupName in groups) {
                series = groups[groupName];
                _results1.push({
                  name: groupName,
                  features: {
                    palette: 'spectrum14',
                    hover: {},
                    xAxis: {},
                    yAxis: {},
                    legend: {
                      toggle: true,
                      highlight: true
                    }
                  },
                  options: {
                    renderer: __indexOf.call(areaGraphs, groupName) >= 0 ? 'area' : 'line'
                  },
                  series: (function() {
                    var _results2;
                    _results2 = [];
                    for (name in series) {
                      data = series[name];
                      _results2.push({
                        name: name,
                        data: data
                      });
                    }
                    return _results2;
                  })()
                });
              }
              return _results1;
            })()
          });
        }
        return _results;
      })();
      $scope.quantiles = {
        name: "Response time quantiles",
        features: {
          palette: 'classic9',
          hover: {},
          xAxis: {},
          yAxis: {},
          legend: {
            toggle: true,
            highlight: true
          }
        },
        options: {
          renderer: 'area',
          unstack: true,
          // height: $element[0].offsetHeight - 45 - 62
        },
        series: ((function() {
          var _ref, _results;
          _ref = overallData.quantiles;
          _results = [];
          for (name in _ref) {
            data = _ref[name];
            _results.push({
              name: name,
              data: data
            });
          }
          return _results;
        })()).sort(function(a, b) {
          if (parseFloat(a.name) <= parseFloat(b.name)) {
            return 1;
          } else {
            return -1;
          }
        })
      };
      $scope.rps = {
        name: "Responses per second",
        features: {
          palette: 'spectrum14',
          hover: {},
          xAxis: {},
          yAxis: {},
          legend: {
            toggle: true,
            highlight: true
          }
        },
        options: {
          renderer: 'area',
          stack: true,
          height: $element[0].offsetHeight - 45 - 62
        },
        series: [
          {
            name: 'RPS',
            data: overallData.RPS
          }
        ]
      };
      $scope.protoCodes = {
        name: "Protocol return codes",
        features: {
          palette: 'spectrum14',
          hover: {},
          xAxis: {},
          yAxis: {},
          legend: {
            toggle: true,
            highlight: true
          }
        },
        options: {
          renderer: 'area',
          stack: true,
          height: $element[0].offsetHeight - 45 - 62
        },
        series: ((function() {
          var ref, results;
          ref = overallData.http_codes;
          results = [];
          for (name in ref) {
            data = ref[name];
            results.push({
              name: name,
              data: data
            });
          }
          return results;
        })()).sort(function(a, b) {
          if (parseFloat(a.name) <= parseFloat(b.name)) {
            return 1;
          } else {
            return -1;
          }
        })
      };
      return $scope.netCodes = {
        name: "Network return codes",
        features: {
          palette: 'spectrum14',
          hover: {},
          xAxis: {},
          yAxis: {},
          legend: {
            toggle: true,
            highlight: true
          }
        },
        options: {
          renderer: 'area',
          stack: true,
          height: $element[0].offsetHeight - 45 - 62
        },
        series: ((function() {
          var ref, results;
          ref = overallData.net_codes;
          results = [];
          for (name in ref) {
            data = ref[name];
            results.push({
              name: name,
              data: data
            });
          }
          return results;
        })()).sort(function(a, b) {
          if (parseFloat(a.name) <= parseFloat(b.name)) {
            return 1;
          } else {
            return -1;
          }
        })
      };
    };
    $scope.buildSeries();
  });
}).call(this);
    </script>
  </head>
  <body>
    <div ng-app="ng-tank-report" ng-controller="TankReport" class="app container">
      <h1 class="page-header">Yandex.Tank online report</h1>
      <div id="status">{{status}}</div>
      <div id="timings">
        <div class="panel panel-default">
          <div class="panel-heading">
            <h3 class="panel-title">{{quantiles.name}}</h3>
          </div>
          <div class="panel-body">
            <rickshaw rickshaw-series="quantiles.series" rickshaw-options="quantiles.options" rickshaw-features="quantiles.features" class="panel-body"></rickshaw>
          </div>
        </div>
        <div class="panel panel-default">
          <div class="panel-heading">
            <h3 class="panel-title">{{rps.name}}</h3>
          </div>
          <div class="panel-body">
            <rickshaw rickshaw-series="rps.series" rickshaw-options="rps.options" rickshaw-features="rps.features"></rickshaw>
          </div>
        </div>
      </div>
      <div id="codes">
        <div class="panel panel-default">
          <div class="panel-heading">
            <h3 class="panel-title">{{protoCodes.name}}</h3>
          </div>
          <div class="panel-body">
            <rickshaw rickshaw-series="protoCodes.series" rickshaw-options="protoCodes.options" rickshaw-features="protoCodes.features"></rickshaw>
          </div>
        </div>
        <div class="panel panel-default">
          <div class="panel-heading">
            <h3 class="panel-title">{{netCodes.name}}</h3>
          </div>
          <div class="panel-body">
            <rickshaw rickshaw-series="netCodes.series" rickshaw-options="netCodes.options" rickshaw-features="netCodes.features"></rickshaw>
          </div>
        </div>
      </div>
      <div id="monitoring">
        <div ng-repeat="host in monitoringData" class="host">
          <h3>{{host.hostname}}</h3>
          <div ng-repeat="group in host.groups" class="panel panel-default">
            <div class="panel-heading">
              <h3 class="panel-title">{{group.name}}</h3>
            </div>
            <div class="panel-body">
              <rickshaw rickshaw-series="group.series" rickshaw-options="group.options" rickshaw-features="group.features"></rickshaw>
            </div>
          </div>
        </div>
      </div>
    </div>
  </body>
</html>
